          if (asprintf (&cell, _("%s-%s"), num, header) == -1)
            cell = NULL;
        }
      else
        cell = strdup (header);

      if (!cell)
        xalloc_die ();

      hide_problematic_chars (cell);

      (|1|)[(|2|) - 1][(|3|)] = cell;

      (|0|)[(|3|)]->width = MAX (columns[col]->width, mbswidth (cell, 0));
    }
